import React, {Components} from 'react';
import './style-buttom-a.css';

class Button extends React.Components {
	render(){
		return(
		 <div>
		    <Button
		      href="#"
		      target="_blank"
		      rel="noopener"
		      primary
		    >
		      Boton
		    </Button>
		  </div>
	  	);
	}
}
export default Button;
